import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      users: [],
      //listings: []
    };
  }


  // componentDidMount() {
  //   this.fetchData();
  // }


  render() {
    return (
      <div className="App">
        <div className="App__Aside"></div>
        <div className="App__Form">

          <div>
            <h1>Welcome to staycation</h1>
            <p>where luxurious vacation is is just a click away</p>
          </div>
          <div>
            <h3>Join the club</h3><button>onClick= SIGN UP</button>
          </div>
        </div>
      </div>

    );
  }
}


export default App;
